package com.javafundas;

/**
 * Printing elements in array
 * @author ssampath
 * Date 25/04/2023
 */
public class ForEachPrint {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int marks[]= {125, 132, 95, 116, 110};
		for(int i:marks) {
			System.out.println(i);
		}
	}

}
